import React from 'react'
import Product from './Product'
export default function ProductList(props) {
  return(
    props.productList.map((product,i)=>{
        return <Product product={product} key={i} incrementQuantity={props.incrementQuantity} decrementQuantity={props.incrementQuantity} index={i}/>
    })
  )
}
